    };

    return (
        <div className="nav-bar">
            <div className="chip">
                <Link to="https://miiree12lb.site/">
                    <img src={logo} alt="logo" width="50" height="50" />
                </Link>
                React Code Generator
            </div>

            <button onClick={toggleTheme}>
                
            </button>
        </div>
    );

}

